import { jsPDF } from "jspdf";
import autoTable from "jspdf-autotable";
import { formatRupiah } from "./format";

const OUTFIT_REGULAR = ``;
const OUTFIT_SEMIBOLD = ``;

export const exportReportToPDF = (data, filename) => {
  if (!data || data.length === 0) {
    console.warn("No data to export");
    return;
  }

  const doc = new jsPDF({
    orientation: "portrait",
    unit: "mm",
    format: "a4",
  });

  doc.addFileToVFS("Outfit-Regular.ttf", OUTFIT_REGULAR);
  doc.addFont("Outfit-Regular.ttf", "Outfit", "normal");

  doc.addFileToVFS("Outfit-SemiBold.ttf", OUTFIT_SEMIBOLD);
  doc.addFont("Outfit-SemiBold.ttf", "Outfit", "semibold");

  // title
  const title = `Annual Report ${filename.split("_").pop()}`;
  doc.setFont("Outfit", "semibold");
  doc.setFontSize(18);
  const pageWidth = doc.internal.pageSize.getWidth();
  doc.text(title, pageWidth / 2, 15, { align: "center" });

  // Data
  const columns = ["Month", "Year", "Transactions", "Revenue"];
  const rows = data.map((row) => [
    row.month,
    row.year.toString(),
    row.transactions.toString(),
    formatRupiah(row.revenue),
  ]);

  const margin = 15;
  const tableWidth = pageWidth - 2 * margin;
  const colRatio = [0.25, 0.2, 0.25, 0.3];
  const columnWidths = colRatio.map((ratio) => tableWidth * ratio);

  autoTable(doc, {
    startY: 25,
    head: [columns],
    body: rows,
    theme: "grid",
    tableLineColor: [137, 92, 214],
    tableLineWidth: 0.3,
    headStyles: {
      fillColor: [137, 92, 214],
      textColor: [255, 255, 255],
      font: "Outfit",
      fontStyle: "semibold",
      fontSize: 12,
      cellPadding: 4,
      halign: "center",
    },
    bodyStyles: {
      font: "Outfit",
      fontStyle: "normal",
      fontSize: 11,
      textColor: [0, 0, 0],
      cellPadding: 4,
    },
    columnStyles: {
      0: { cellWidth: columnWidths[0], halign: "left" },
      1: { cellWidth: columnWidths[1], halign: "center" },
      2: { cellWidth: columnWidths[2], halign: "center" },
      3: { cellWidth: columnWidths[3], halign: "right" },
    },
    margin: { top: 25, left: margin, right: margin },
    didDrawPage: (data) => {
      const pageSize = doc.internal.pageSize;
      const pageHeight = pageSize.height || pageSize.getHeight();
      doc.setFont("Outfit", "normal");
      doc.setFontSize(9);
      doc.setTextColor(150);
      doc.text("Generated by Zotu System", pageWidth / 2, pageHeight - 10, {
        align: "center",
      });
    },
  });

  doc.save(`${filename}.pdf`);
};
